// Next.js는 import React from 'react' 구문이 필요없음

import AppLayout from "../components/AppLayout";

const Home = () => {
  return (
    // 다른 컴포넌트로 감싸줄 경우 다른 컴포넌트 사용 가능
    <AppLayout>
      <div>Hello, Next!</div>
    </AppLayout>
  );
};

export default Home;
